import React,{Component} from 'react';
import 'tachyons';
import './Nav.scss';
import logo from './debuggedlogo.png';

const Nav =({onRouteChange,route})=>
{
    return (
      <div>
       <nav className={`flex bg-black white items-center justify-between pv0 mv0 flex-wrap w-100 ${navbar}`}>
           <span>
               <div style={{height:'60px', width:'60px'}} className='mh2'>
                   <img style={{height:'100%', width:'100%'}} src='http://skyboxathlete.com/wp-content/uploads/2020/12/WhatsApp-Image-2020-12-17-at-1.44.44-PM-1.jpeg' alt='Logo'/>
               </div>
           </span>
           <span className={`hamburger ${line} pr2`} 
           onClick={()=>hamburger()}
           >
                   <div className='line'></div>
                   <div className='line'></div>
                   <div className='line'></div>
       </span>
           <span className={`${dropdown}`}>
               <ul style={{listStyle:'none'}} className={`flex ph4 ${navbar} justify-center items-center ${dropdown}`}>
                   <li style={{cursor:'point',backgroundColor:'#00D0FF'}} className='f4 grow ph3 mv0 br2 black b pa2 pointer'>Enroll Now</li>
                   <li className={`nav  ul f4 ${route==='home'?'active1':'left ul'} `} onClick={()=>onRouteChange('home')} href='#0'>Home</li>
                   <li className={`nav  ul f4 ${route==='home'?'active1':'left ul'} `} onClick={()=>onRouteChange('home')} href='#0'>Events</li>
                   <li className={`nav  ul f4 ${route==='home'?'active1':'left ul'} `} onClick={()=>onRouteChange('home')} href='#0'>Blog</li>
                   <li className={`nav  ul f4 ${route==='home'?'active1':'left ul'} `} onClick={()=>onRouteChange('home')} href='#0'>About Us</li>
                   <li className={`nav  ul f4 ${route==='home'?'active1':'left ul'} `} onClick={()=>onRouteChange('home')} href='#0'>Contact Us</li>
                   <li className={`nav  ul f4 ${route==='home'?'active1':'left ul'} `} onClick={()=>onRouteChange('home')} href='#0'>SignIn</li>
                   <li className={`nav  ul f4 ${route==='home'?'active1':'left ul'} `} onClick={()=>onRouteChange('home')}><p className={`f6 link dim ph3 pv2 mb2 dib white bg-dark-blue cross`} href='#0'
                   onClick={()=>hamburger()}
                   >
                   X
                   </p>
                   </li>
               </ul>
           </span>
       </nav>
   </div>
     //  <div>
     //  <div className="Home" style={{backgroundcolor:'black'}}>
     //  <div className="topnav">
     //  <img src={logo} alt="debugged icon" className="logo"/>
     //   &nbsp;
     //   <ol className="navhead" type="1">
     //   <li  className={`nav  ul f4 ${route==='home'?'active1':'left ul'} `} onClick={()=>onRouteChange('home')}>About Us</li>
     //   <li  className={`nav ul f4 ${route==='work'?'active1':'left ul'} mr2.5`} onClick={()=>onRouteChange('work')}>Our work</li>
     //   <li  className={`nav ul f4 ${route==='contact'?'active1':'left ul'}`} onClick={()=>onRouteChange('contact')}>Contact us</li>
     //   </ol>
     //   </div>
     // </div>
     // </div>
    );
  }

export default Nav;
